import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { Typography, Box, Tooltip, Link, List, ListItem, ListItemText } from '@mui/material';

function ResumeAtsScorePage() {
  const navigate = useNavigate();
  const location = useLocation();
  const [isBackNavigation, setIsBackNavigation] = useState(false);

  useEffect(() => {
    if (isBackNavigation) {
      navigate('/');
    }
  }, [isBackNavigation, navigate]);

  useEffect(() => {
    return location.listen(({ action }) => {
      if (action === 'POP') {
        setIsBackNavigation(true);
      }
    });
  }, [location]);

  const missingTechnicalSkills = {
    "React": "https://www.google.com/search?q=React",
    "Node.js": "https://www.google.com/search?q=Node.js",
    "MongoDB": "https://www.google.com/search?q=MongoDB"
  };

  const missingSoftSkills = [
    "Communication",
    "Teamwork",
    "Problem-solving",
    "Adaptability"
  ];

  const resumeScore = 75;

  return (
    <Box sx={{ maxWidth: 600, mx: 'auto', my: 4 }}>
      <Typography variant="h3" textAlign="center" gutterBottom>
        Resume ATS Score
      </Typography>
      <Typography variant="h4" textAlign="center" color="primary" gutterBottom>
        Your ATS Score: {resumeScore}
      </Typography>
      <Box my={2}>
        <Typography variant="h5" gutterBottom>Missing Technical Skills:</Typography>
        <List>
          {Object.entries(missingTechnicalSkills).map(([skill, url], index) => (
            <Tooltip key={index} title={`Learn more about ${skill}`} arrow>
              <ListItem button component="a" href={url} target="_blank" rel="noopener noreferrer">
                <ListItemText primary={skill} />
              </ListItem>
            </Tooltip>
          ))}
        </List>
      </Box>
      <Box my={2}>
        <Typography variant="h5" gutterBottom>Missing Soft Skills:</Typography>
        <List>
          {missingSoftSkills.map((skill, index) => (
            <ListItem key={index} sx={{ color: 'grey.500' }}>
              <ListItemText primary={skill} />
            </ListItem>
          ))}
        </List>
      </Box>
    </Box>
  );
}

export default ResumeAtsScorePage;
